import React from "react";

import styled from "styled-components";
import Data from "../Entites/Data";

const Icons = [
  <Icon id="facebook" className="social" />,
  <Icon id="isq" className="social" />,
  <Icon id="linkedin" className="social" />,
  <Icon id="instagtam" className="social" />,
  <Icon id="odnorlassniki" className="social" />,
  <Icon id="skype" className="social" />,
  <Icon id="telegram" className="social" />,
  <Icon id="tenchat" className="social" />,
  <Icon id="tikTok" className="social" />,
  <Icon id="twitter" className="social" />,
  <Icon id="viber" className="social" />,
  <Icon id="vk" className="social" />,
  <Icon id="whatUp" className="social" />,
  <Icon id="youTube" className="social" />,
  <Icon id="call" className="social" />,
  <Icon id="save" className="social" />,
];

const MainConteiner = styled.div``;

const IconsConteiner = styled.div`
  padding-left: 15px;
  margin-top: 23px;
  display: flex;
  grid-gap: 5px;
`;

const Vector = styled.div`
  height: 1px;
  border-top: solid 1.7px #060606;
  margin-top: 23px;
`;

export default function Footer() {
  const { Links } = Data.person;
  console.log(Links);
  return (
    <MainConteiner>
      <Vector />
      <IconsConteiner>
        {Links.map((Links) => (
          <a href={Links.url}> {Links.icon}</a>
        ))}
      </IconsConteiner>
    </MainConteiner>
  );
}
